function array_map(tbl, f)
	local t = {}
	for k,v in pairs(tbl) do
		t[k] = f(v)
	end
	return t
end

function array_findIndex(tbl, targetValue)
	for k,v in pairs(tbl) do
		if v == targetValue then
			return k
		end
	end
end

function dist(a, b)
	return math.sqrt((b.x - a.x)^2 + (b.y - a.y)^2)
end

Enemy = {}
Enemy.__index = Enemy

function Enemy:new()
	local enemy={
		x=80,
		y=40,
		spd=0,dir=0,
		rspd=0.06,
		MAXSPD=1.4,ACCAMT=0.05,DECAMT=1.02,
		pstate='follow',
		pstates={'follow', 'hitstun'},
		lasthit=nil,DEATHANIMLEN=80,
		hitboxr=8,
	}
	setmetatable(enemy, self)
	return enemy
end

function Enemy:TIC()
	local should_draw=true
	local curspr=340

	if self.pstate == 'follow' then
		--dists = array_map(ships, function (ship) return dist(ship, self) end)
		local targetship = ships[1] --ships[array_findIndex(dists, math.max(unpack(dists)))]

		if (self.x < targetship.x + 4) then self.x=self.x+1
		elseif (self.x > targetship.x + 4) then self.x=self.x-1 end
		if (self.y < targetship.y + 4) then self.y=self.y+1
		elseif (self.y > targetship.y + 4) then self.y=self.y-1 end
	elseif self.pstate == 'hitstun' then
		if t-self.lasthit > self.DEATHANIMLEN then
			table.remove(enemies, array_findIndex(enemies, self))
		end
		should_draw=(t%16)==0
	end

	if should_draw then
		spr(curspr,cam.x+self.x-4,cam.y+self.y-4,0,1,0,0,1,1)
		spr(curspr+1,cam.x+self.x+4,cam.y+self.y-4,0,1,0,0,1,1)
		spr(curspr+16,cam.x+self.x-4,cam.y+self.y+4,0,1,0,0,1,1)
		spr(curspr+17,cam.x+self.x+4,cam.y+self.y+4,0,1,0,0,1,1)
	end
end

Ship = {}
Ship.__index = Ship

function Ship:new(pnum)
	local pnum=pnum or 0
	local ship={
		x=120+pnum*24,
		y=64,
		spd=0,dir=0,
		rspd=0.06,
		MAXSPD=1.4,ACCAMT=0.05,DECAMT=1.02,
		pstate='free',
		pstates={'free','drift','boost','hitstun'},
		driftdir=0,driftside='m',lastdrift=0,
		DRIFTACCWIN=30,
		BOOSTSPDS={8,8,6,5,3,3,3,2.5,1.25,0.9},
		lastboost=-80,BOOSTCD=80,
		boostx=0,boosty=0,
		hitboxr=8,

		pnum=pnum,
	}
	setmetatable(ship, self)
	return ship
end

function Ship:TIC()
	local accel=false
	local turnl,turnr=false,false
	local debugtxt=''

	if btn(self.pnum*8+0) then accel=true end
	if btn(self.pnum*8+1) then accel=false end
	if btn(self.pnum*8+2) then turnl=true end
	if btn(self.pnum*8+3) then turnr=true end
	if btn(self.pnum*8+4) then
		if self.pstate=='free' and t-self.BOOSTCD > self.lastboost then
			self.driftdir=self.dir
			self.pstate='drift'
			if turnl then self.driftside='l'
			elseif turnr then self.driftside='r'
			end
			self.lastdrift=t
		end
	else
		if self.pstate=='drift' then
			if t-self.BOOSTCD > self.lastboost then
				self.lastboost=t
				self.pstate='boost'
				self.boostx=self.x
				self.boosty=self.y
			else
				self.pstate='free'
				self.driftside='m'
			end
		end
	end
	
	if self.pstate=='free' then
		if accel then
			self.spd=math.min(self.spd+self.ACCAMT,self.MAXSPD)
		else
			self.spd=self.spd/self.DECAMT
		end
		if turnl then
			self.dir=self.dir+self.rspd
		elseif turnr then
			self.dir=self.dir-self.rspd
		end
	elseif self.pstate=='drift' then
		-- during drifting, self.driftdir refers to the direction of movement
		-- self.dir refers to the direction the ship points
		-- and the direction the player will move when ending drift
		-- these are only different during DRIFFACCWIN
		if accel then
			self.spd=math.min(self.spd+self.ACCAMT,self.MAXSPD)
		else
			self.spd=self.spd/((1+self.DECAMT)/2)
		end
		if self.driftside=='l' then
			local scale=1
			if t-self.lastdrift < self.DRIFTACCWIN then
				scale=(t-self.lastdrift)^2/self.DRIFTACCWIN^2
			end
			if turnl then
				self.driftdir=self.driftdir+scale*self.rspd*1.2
				--debugtxt=debugtxt..'rspd '..(scale*self.rspd/1.2)..'\n'
			elseif turnr then
				self.driftdir=self.driftdir-scale*self.rspd/2.5
				--debugtxt=debugtxt..'rspd '..(-scale*self.rspd/2.5)..'\n'
			else
				self.driftdir=self.driftdir+scale*self.rspd/2
				--debugtxt=debugtxt..'rspd '..(scale*self.rspd/2)..'\n'
			end
		elseif self.driftside=='r' then
			local scale=1
			if t-self.lastdrift < self.DRIFTACCWIN then
				scale=(t-self.lastdrift)^2/self.DRIFTACCWIN^2
			end
			if turnl then
				self.driftdir=self.driftdir+scale*self.rspd/2.5
				--debugtxt=debugtxt..'rspd '..(scale*self.rspd/2.5)..'\n'
			elseif turnr then
				self.driftdir=self.driftdir-scale*self.rspd*1.2
				--debugtxt=debugtxt..'rspd '..(-scale*self.rspd/1.2)..'\n'
			else
				self.driftdir=self.driftdir-scale*self.rspd/2
				--debugtxt=debugtxt..'rspd '..(-scale*self.rspd/2)..'\n'
			end
		end
		if self.driftside=='l' then
			if t-self.lastdrift < 3*self.DRIFTACCWIN then
				self.dir=math.min(self.dir+self.rspd,self.driftdir+10*self.rspd)
			else
				self.dir=self.driftdir
			end
		elseif self.driftside=='r' then
			if t-self.lastdrift < 3*self.DRIFTACCWIN then
				self.dir=math.max(self.dir-self.rspd,self.driftdir-10*self.rspd)
			else
				self.dir=self.driftdir
			end
		end
	end
	self.dir=self.dir%(math.pi*2)
	self.driftdir=self.driftdir%(math.pi*2)
	--debugtxt=debugtxt..'dir: '..(self.dir)..'\n'
	--debugtxt=debugtxt..'ddir: '..(self.driftdir)..'\n'
	
	-- drifting suspends normal movement
	if self.pstate=='drift' then
		self.x=self.x+self.spd*math.cos(self.driftdir)
		self.y=self.y-self.spd*math.sin(self.driftdir)
	elseif self.pstate=='boost' then
		self.spd=self.BOOSTSPDS[t-self.lastboost+1]
		if self.spd==nil then
			self.spd=self.MAXSPD
			self.pstate='free'
			self.driftside='m'
		end
		self.x=self.x+self.spd*math.cos(self.dir)
		self.y=self.y-self.spd*math.sin(self.dir)
	else
		self.x=self.x+self.spd*math.cos(self.dir)
		self.y=self.y-self.spd*math.sin(self.dir)
	end

	-- draw
	local indx=self.x+15*math.cos(self.dir)
	local indy=self.y-15*math.sin(self.dir)
	local curspr=272
	
	if self.dir<math.pi*2 then curspr=276 end -- E
	if self.dir<math.pi*(7/4+1/8) then curspr=286 end -- SE
	if self.dir<math.pi*(6/4+1/8) then curspr=272 end -- S
	if self.dir<math.pi*(5/4+1/8) then curspr=284 end -- SW
	if self.dir<math.pi*(1+1/8) then curspr=278 end -- W
	if self.dir<math.pi*(3/4+1/8) then curspr=280 end -- NW
	if self.dir<math.pi*(2/4+1/8) then curspr=274 end -- N
	if self.dir<math.pi*(1/4+1/8) then curspr=282 end -- NE
	if self.dir<math.pi*1/8 then curspr=276 end -- E

	--spr(1+t%60//30*2,x,y,14,1,0,0,1,1)
	spr(curspr,cam.x+self.x-4,cam.y+self.y-4,0,1,0,0,1,1)
	spr(curspr+1,cam.x+self.x+4,cam.y+self.y-4,0,1,0,0,1,1)
	spr(curspr+16,cam.x+self.x-4,cam.y+self.y+4,0,1,0,0,1,1)
	spr(curspr+17,cam.x+self.x+4,cam.y+self.y+4,0,1,0,0,1,1)
	spr(256,cam.x+indx,cam.y+indy,0,1,0,0,1,1) -- indicator
	if DEV then
		print(debugtxt,cam.x+self.x+8,cam.y+self.y+8,15,false,1,true)
	end
	-- fx
	local driftt=t-self.lastdrift
	if self.pstate=='drift' then
		circb(self.x+4+cam.x,self.y+4+cam.y,7+(driftt/7)%8,14+(driftt/7)%2)
	elseif self.pstate=='boost' then
		if self.lastboost==t then sfx(0,'C-4') end
		if self.lastboost + 12 > t then
			local boostdestx=self.boostx+30*math.cos(self.dir)
			local boostdesty=self.boosty-30*math.sin(self.dir)
			line(cam.x+self.boostx+4,cam.y+self.boosty+4,boostdestx+4+cam.x,boostdesty+4+cam.y,14+(driftt/3)%2)
		end
	end
end

function dist(x1,y1,x2,y2)
	return math.sqrt((x2-x1)^2+(y2-y1)^2)
end

t=0
ships={Ship:new(0), Ship:new(1)}
cam={x=120,y=68}
enemies={Enemy:new()}
function remap(tile,x,y)
	if tile==48 or tile==49 then
		return t//60%2+48
	end
	if tile==80 then
		return (t//60%2)*32+80
	end
	if tile==81 then
		return (t//60%2)*32+81
	end
	if tile==96 then
		return (t//60%2)*32+96
	end
	if tile==97 then
		return (t//60%2)*32+97
	end
	return tile
end
function lerp(a,b,t) return (1-t)*a + t*b end
--music(1)

function TIC()
	-- follow one player
	cam.x=math.min(120,120-ships[1].x)
	cam.y=math.min(64,64-ships[1].y)
	-- follow all players
	--avgx=(ships[1].x + ships[2].x)/2
	--avgy=(ships[1].y + ships[2].y)/2
	--cam.x=math.min(120,120-avgx)
	--cam.y=math.min(64,64-avgy)
	-- follow one player with some leeway
	--cam.x=math.min(120,lerp(cam.x,120-ships[1].x,0.05))
	--cam.y=math.min(64,lerp(cam.y,64-ships[1].y,0.05))
	-- camera cell x / y
	local ccx=-cam.x/8
	local ccy=-cam.y/8
	-- draw ocean background
	map(
		math.ceil(ccx-15), math.ceil(ccy-8), -- ceil fixes jumping crossing 0
		32,18, -- draw the whole screen's worth
		(cam.x%8)-8,(cam.y%8)-8, -- minus 8 makes sure we fill the screen
		-1,1,remap
	)
	if DEV then
		--print(string.format('cam.x %.2f\ncam.y %.2f\nmap start x %.2f \nmap start y %.2f \ncam.x mod 8 %.2f \ncam.y mod 8 %.2f', cam.x, cam.y, ccx-15, ccy-8,(cam.x%8),(cam.y%8)),30,30,15,true)
	end
	for i,enemy in ipairs(enemies) do
		enemy:TIC()
	end
	for i,ship in ipairs(ships) do
		ship:TIC()
		for j=i+1,#ships do
			local d=math.abs(dist(ship.x,ship.y,ships[j].x,ships[j].y))
			if d<=2*math.max(ship.hitboxr,ships[j].hitboxr) then
				if DEV then
					circ(ship.x+4+cam.x,ship.y+4+cam.y,ship.hitboxr,8)
					circ(ships[j].x+4+cam.x,ships[j].y+4+cam.y,ships[j].hitboxr,8)
				end
			end
		end
		for j=1,#enemies do
			local d=math.abs(dist(ship.x,ship.y,enemies[j].x,enemies[j].y))
			if d<=2*math.max(ship.hitboxr,enemies[j].hitboxr) then
				if ship.pstate == 'boost' then
					enemies[j].pstate = 'hitstun'
					enemies[j].lasthit = t
				else
					-- ship.pstate = 'hitstun'
				end
				if DEV then
					if enemies[j].pstate ~= 'hitstun' then
						circ(ship.x+4+cam.x,ship.y+4+cam.y,ship.hitboxr,8)
						circ(enemies[j].x+4+cam.x,enemies[j].y+4+cam.y,enemies[j].hitboxr,8)
					end
				end
			end
		end
	end
	print('DRIFTWINDS alpha', 4, 4, 15)
	t=t+1
end

